import React from "react";
import arrayProducts from "../../Json/Products.json";
import ItemList from "../ItemList/ItemList";

const Productos = () => {
  // En lugar de obtener los datos aquí, simplemente pasa los datos de arrayProducts.
  // No es necesario el uso de `useState` o `useEffect` en este caso.
  return (
    <div className="productos-container">
      <h1>Todos los productos</h1>
      <ItemList item={arrayProducts} />
    </div>
  );
};

export default Productos;
